import React from "react";
import logo from "../../asset/logo.png";

export default function Login() {
  return (
    <div className="login">
      <header className="login-header">
        <img src={logo} alt="logo" />
        <h1>While True Codes Education System</h1>
      </header>

      <div></div>
    </div>
  );
}
